    return(
        <>
           <div className="main-note">
           <input type="text" placeholder="title" value="" onChange="" />
           <textarea rows="" column="" placeholder="write a note..."></textarea>
            <Button><AddIcon/></Button>
           
           </div>
        </>
    );
}

export default CreateNote;
